import { Route, Switch } from "react-router";
import AllQuotes from "./pages/AllQuotes";
import NewQuotes from "./pages/NewQuotes";

function App() {
  return (
    <Switch>
      <Route path="/quotes">
        <AllQuotes />
      </Route>
      <Route path='/quotes/:quotes'>
        <NewQuotes />
      </Route>
    </Switch>
  );
}

export default App;
